import { useState } from "react";
import Card from "./components/Card/Card";
import "./App.css";
import "./components/Card/shop.css";


function App() {
    const products = [
        { id: 1, title: "Ноутбук", image: "data:image/jpeg;base64," },
        { id: 2, title: "Смартфон", image: "data:image/jpeg;base64," },
        { id: 3, title: "Наушники", image: "data:image/jpeg;base64," },
        { id: 4, title: "Компьютер", image: "data:image/jpeg;base64," },
        { id: 5, title: "Коврик", image: "data:image/jpeg;base64," },
        { id: 6, title: "Кресло", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQRYePzNGi0GXklQPCsFQYi0IxyNaltsGDX_Q&s" },
        { id: 7, title: "Джостик", image: "data:image/jpeg;base64," },
        { id: 8, title: "Клавиатура", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQebi50D9dU92C-tPMN9kHfyLUuhlyyRe9H-g&s" },
    ];

    const [cart, setCart] = useState([]);

    const addToCart = (id, title) => {
        console.log(id, title);
        setCart([...cart, title]);
    };

    return (
        <div className="app">
            <h1 className="title">GAME SHOP</h1>

            <div className="products">
                {products.map((item) => (
                    <Card
                        key={item.id}
                        id={item.id}
                        title={item.title}
                        image={item.image}
                        onAdd={addToCart}
                    />
                ))}
            </div>

            <h2 className="cart-title">Корзина</h2>

            <div className="cart">
                {cart.length === 0 ? (
                    <p className="empty">Корзина пуста</p>
                ) : (
                    cart.map((item, index) => (
                        <p className="cart-item" key={index}>
                            {item}
                        </p>
                    ))
                )}
            </div>
        </div>
    );
}

export default App;
